#coding:utf-8
"""
给定一个二维网格和一个单词，找出该单词是否存在于网格中。

单词必须按照字母顺序，通过相邻的单元格内的字母构成，其中“相邻”单元格是那些水平相邻或垂直相邻的单元格。同一个单元格内的字母不允许被重复使用。

示例:

board =
[
  ['A','B','C','E'],
  ['S','F','C','S'],
  ['A','D','E','E']
]

给定 word = "ABCCED", 返回 true.
给定 word = "SEE", 返回 true.
给定 word = "ABCB", 返回 false.


来源：力扣（LeetCode）
链接：https://leetcode-cn.com/problems/word-search
著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
"""

class Solution(object):
    def exist(self, board, word):
        """
        :type board: List[List[str]]
        :type word: str
        :rtype: bool
        """
        if word == None or len(word) == 0:
            return True
          
        if board is None or len(board) ==0 or len(board[0]) == 0 :
            return False
        
        rows = len(board)
        cols = len(board[0])
        
        
        
        wordlist = list(word)
        word_length = len(wordlist)
        
        if  word_length > rows * cols:
            return False
        res = []
        for i in range(rows):
            for j in range(cols):
                if board[i][j] == word[0]:
                    visted = [[False for _ in range(cols)] for _ in range(rows)]
                    if self.dfs(board, visted, i, j, rows, cols, wordlist, 0, word_length):
                        return True
        # print(res)
        return False
                    
                    
    def dfs(self, board, visted, r, c, rows, cols, wordlist, cur, word_length):
        if r < 0 or r >= rows or c <0 or c >= cols or \
            visted[r][c] == True or board[r][c] != wordlist[cur]:
            return False
        # print(cur)
        visted[r][c] = True
        cur+=1
        if cur == word_length:
            return True
        
        if self.dfs(board, visted, r+1, c, rows, cols, wordlist, cur, word_length):
            return True #or \
        if self.dfs(board, visted, r-1, c, rows, cols, wordlist, cur, word_length):
            return True #or \
        if  self.dfs(board, visted, r, c+1, rows, cols, wordlist, cur, word_length):
            return True #or \
        if self.dfs(board, visted, r, c-1, rows, cols, wordlist, cur, word_length):
            return True
        visted[r][c] = False
        
        return False
        #return any([res1, res2, res3, res4])
        #visted[r][c] = False
